import React from "react";

function Editprofile(){

    let divStyle = {

        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        alignItems: 'center',
        background: 'white'


    }
    let formStyle = {
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        alignItems: 'center'
    }


    return(
        <>
        <div style = {divStyle} id = "profile-change-form-container">
            <h3>Edit Profile</h3>
            <form style = {formStyle} method = "POST" action = "/api/editprofile">
                <input type = "file" id = "profile-changer"/>
                <input type = "text" id = "new-photo-url"/>
                <input type = "text" id = "username" placeholder="Username"/>
                <div id = "fname-lname-container">
                    <input type = "text" id = "fname" placeholder="First Name"/>
                    <input type = "text" id = "lname" placeholder="Last Name"/>
                </div>
                <input type = "submit" id = "btn-submit"/>
            </form>
        </div>
        </>

    );


}

export default Editprofile;
